import React from 'react';

function Card(props){
    const style = {
        width : "17rem"
    }
    console.log(props)
    return(
        <div className={props.cal === undefined ? `card`: `card ${props.cal.className}`} style={props.cal === undefined ? {height:'400px',marginTop:'500px'} : style} >
                <img class="card-img-top" src={props.imageUrl} alt="Card image cap" />
                <div class="card-body">
                    <h5 class="card-title">{props.heading}</h5>
                    <p class="card-text">{props.content}</p>
                </div>
            </div>
    )
}
export default Card;
